pragma solidity 0.8.18;

contract EnoughBalance {

    // struct Wallet {
    //     address owner;
    //     uint balance;
    // }

    // mapping (address => Wallet) wallets;

    // modifier enoughBalance(uint amount) {
    //     require(amount <= wallets[msg.sender].balance, "You can't spend more than you have");
